"use strict";(self.webpackChunkdocumentation=self.webpackChunkdocumentation||[]).push([[9086],{2438:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"laravel-connect-postgresql","metadata":{"permalink":"/docusaurus/blog/laravel-connect-postgresql","editUrl":"https://github.com/Izfaha/docusaurus/tree/main/blog/2025-august/2025-8-19-laravel-12-postgresql.md","source":"@site/blog/2025-august/2025-8-19-laravel-12-postgresql.md","title":"Connecting Laravel 12 to PostgreSQL in Arch Linux","description":"Installing PostgreSQL","date":"2025-08-19T00:00:00.000Z","tags":[{"inline":false,"label":"linux","permalink":"/docusaurus/blog/tags/linux","description":"linux"},{"inline":false,"label":"Docusaurus","permalink":"/docusaurus/blog/tags/docusaurus","description":"Docusaurus tag description"}],"readingTime":0.62,"hasTruncateMarker":true,"authors":[{"name":"Fa\'iz Maulana Habibi","title":"College Student of Dian Nuswantoro University","url":"https://github.com/Izfaha","page":{"permalink":"/docusaurus/blog/authors/all-faiz_maulana_habibi-articles"},"socials":{"x":"https://x.com/Xray","linkedin":"https://www.linkedin.com/in/Fa\'iz Maulana Habibi/","github":"https://github.com/Izfaha","newsletter":"https://www.greatfrontend.com"},"imageURL":"https://github.com/JoelMarcey.png","key":"faiz_maulana_habibi"}],"frontMatter":{"slug":"laravel-connect-postgresql","title":"Connecting Laravel 12 to PostgreSQL in Arch Linux","authors":"faiz_maulana_habibi","tags":["linux","docusaurus"]},"unlisted":false,"nextItem":{"title":"PipeWire Installation Arch","permalink":"/docusaurus/blog/pipewire"}},"content":"## Installing PostgreSQL\\n\\nInstall postgresql in your arch using \\n\\n```sh\\nsudo pacman -S postgresql php-pgsql apache\\n\\n# activate postgresql and apache systemd services\\nsudo systemctl enable {postgresql,httpd}\\nsudo systemctl start {postgresql,httpd}\\n\\n# verify\\nsudo systemctl status {postgresql,httpd}\\n```\\n\\n\x3c!-- truncate --\x3e\\n\\nIt will look like this\\n\\n![Systemd Services](./img/apache-postgresql.png)\\n\\n## Create User & Database in postgresql\\n\\n### Create User\\n\\n```sh\\nsudo -iu postgres\\n```\\n\\n![Login PostgreSQL](./img/login-postgresql.png)\\n\\nAfter login to posgresql database, then create user\\n\\n```sh\\n# create new user\\ncreateuser --bypassrls -s -l -d laravel\\n```\\n\\n![Create User](./img/createuser.png)\\n\\n### Create Database\\n\\n```sh\\ncreatedb -O laravel laravel_db\\n```\\n\\n![Create DB](./img/createdb.png)\\n\\n## Set .env in Laravel\\n\\n```sh\\nDB_CONNECTION=pgsql\\nDB_HOST=127.0.0.1\\nDB_PORT=5432                # port postgresql\\nDB_DATABASE=laravel_db      # database\\nDB_USERNAME=laravel         # user\\nDB_PASSWORD=\\n```\\n\\nthen `php artisan migrate:fresh`.\\nDone!"},{"id":"pipewire","metadata":{"permalink":"/docusaurus/blog/pipewire","editUrl":"https://github.com/Izfaha/docusaurus/tree/main/blog/2025-juni/2025-8-19-pipewire.md","source":"@site/blog/2025-juni/2025-8-19-pipewire.md","title":"PipeWire Installation Arch","description":"Installation on Arch Linux","date":"2025-08-19T00:00:00.000Z","tags":[{"inline":false,"label":"linux","permalink":"/docusaurus/blog/tags/linux","description":"linux"},{"inline":false,"label":"Secure","permalink":"/docusaurus/blog/tags/secure","description":"Secure tag description"}],"readingTime":0.27,"hasTruncateMarker":true,"authors":[{"name":"Fa\'iz Maulana Habibi","title":"College Student of Dian Nuswantoro University","url":"https://github.com/Izfaha","page":{"permalink":"/docusaurus/blog/authors/all-faiz_maulana_habibi-articles"},"socials":{"x":"https://x.com/Xray","linkedin":"https://www.linkedin.com/in/Fa\'iz Maulana Habibi/","github":"https://github.com/Izfaha","newsletter":"https://www.greatfrontend.com"},"imageURL":"https://github.com/JoelMarcey.png","key":"faiz_maulana_habibi"}],"frontMatter":{"slug":"pipewire","title":"PipeWire Installation Arch","authors":"faiz_maulana_habibi","tags":["linux","secure"]},"unlisted":false,"prevItem":{"title":"Connecting Laravel 12 to PostgreSQL in Arch Linux","permalink":"/docusaurus/blog/laravel-connect-postgresql"},"nextItem":{"title":"eth0 No IP Address v4","permalink":"/docusaurus/blog/no-ip-in-eth0"}},"content":"## Installation on Arch Linux\\n\\n:::note[Note]\\nRemove PulseAudio if you utilize before.\\n\\n```sh\\nsudo pacman -Rns pulseaudio\\n```\\n\\n:::\\n\\n```sh\\nsudo pacman -S pipewire wireplumber pipewire-pulse pipewire-alsa\\n```\\n\\n\x3c!-- truncate --\x3e\\n\\n## Enable it\\n\\nRun with no sudo because dbus run in tty.\\n\\n```\\nsystemctl --user enable --now pipewire pipewire-pulse wireplumber\\n```\\n\\n## Verify service \\n\\n```sh\\nsystemctl --user status pipewire\\n```"},{"id":"no-ip-in-eth0","metadata":{"permalink":"/docusaurus/blog/no-ip-in-eth0","editUrl":"https://github.com/Izfaha/docusaurus/tree/main/blog/2025-juni/2025-8-8-eth0-no-ip.md","source":"@site/blog/2025-juni/2025-8-8-eth0-no-ip.md","title":"eth0 No IP Address v4","description":"Disclaimer","date":"2025-08-08T00:00:00.000Z","tags":[{"inline":false,"label":"linux","permalink":"/docusaurus/blog/tags/linux","description":"linux"},{"inline":false,"label":"Docusaurus","permalink":"/docusaurus/blog/tags/docusaurus","description":"Docusaurus tag description"}],"readingTime":0.65,"hasTruncateMarker":false,"authors":[{"name":"Fa\'iz Maulana Habibi","title":"College Student of Dian Nuswantoro University","url":"https://github.com/Izfaha","page":{"permalink":"/docusaurus/blog/authors/all-faiz_maulana_habibi-articles"},"socials":{"x":"https://x.com/Xray","linkedin":"https://www.linkedin.com/in/Fa\'iz Maulana Habibi/","github":"https://github.com/Izfaha","newsletter":"https://www.greatfrontend.com"},"imageURL":"https://github.com/JoelMarcey.png","key":"faiz_maulana_habibi"}],"frontMatter":{"slug":"no-ip-in-eth0","title":"eth0 No IP Address v4","authors":"faiz_maulana_habibi","tags":["linux","docusaurus"]},"unlisted":false,"prevItem":{"title":"PipeWire Installation Arch","permalink":"/docusaurus/blog/pipewire"},"nextItem":{"title":"Docker wrong credentials","permalink":"/docusaurus/blog/docker-wrong-credentials"}},"content":"## Disclaimer\\n\\nHi dawg, how are you?\\n\\nrecenly, I could not connect to the internet when I pluged in my LAN into my laptop. Btw, I use Arch Linux in this case.\\n\\nI realized once I hit a command `ip a | ip address show eth0`.\\n\\nthis suspiicius this shown like this\\n\\n![ip_address_show](./img/eth0-no-ip.png)\\n\\nafterward, I briefly verify whether my eth0 is detected then I command `ethtool eth0`. at \'Link detected: yes\'. It\'s FINE so how the fuck is going on. FU\\n\\nCheck if NetworkManager is controlling and Fuckkkkk! yes. I found it disconnect \\"I SAID DAMN SURE\\".\\nit solves using `nmcli device status`.\\n\\n![nmcli_dev_status](./img/nmcli-dev-status.png)8\\n\\n## How I do tackel?\\n\\n```sh\\nsudo nmcli device set eth0 manage yes\\nsudo nmcli device connect eth0\\n```\\n\\nand kaboom!"},{"id":"docker-wrong-credentials","metadata":{"permalink":"/docusaurus/blog/docker-wrong-credentials","editUrl":"https://github.com/Izfaha/docusaurus/tree/main/blog/2025-juni/2025-7-27-docker-fetch-fail.md","source":"@site/blog/2025-juni/2025-7-27-docker-fetch-fail.md","title":"Docker wrong credentials","description":"Resolving Docker Error","date":"2025-07-27T00:00:00.000Z","tags":[{"inline":false,"label":"linux","permalink":"/docusaurus/blog/tags/linux","description":"linux"},{"inline":false,"label":"Secure","permalink":"/docusaurus/blog/tags/secure","description":"Secure tag description"}],"readingTime":0.82,"hasTruncateMarker":false,"authors":[{"name":"Fa\'iz Maulana Habibi","title":"College Student of Dian Nuswantoro University","url":"https://github.com/Izfaha","page":{"permalink":"/docusaurus/blog/authors/all-faiz_maulana_habibi-articles"},"socials":{"x":"https://x.com/Xray","linkedin":"https://www.linkedin.com/in/Fa\'iz Maulana Habibi/","github":"https://github.com/Izfaha","newsletter":"https://www.greatfrontend.com"},"imageURL":"https://github.com/JoelMarcey.png","key":"faiz_maulana_habibi"}],"frontMatter":{"slug":"docker-wrong-credentials","title":"Docker wrong credentials","authors":"faiz_maulana_habibi","tags":["linux","secure"]},"unlisted":false,"prevItem":{"title":"eth0 No IP Address v4","permalink":"/docusaurus/blog/no-ip-in-eth0"},"nextItem":{"title":"Cannot connect to the Docker daemon","permalink":"/docusaurus/blog/docker-daemon-issue"}},"content":"## Resolving Docker Error\\n\\nI have gotten an issue while attemting to build a Docker image with the following command:\\n\\n```sh\\ndocker build -t izfaha/express:v1 .\\n```\\n\\nAnd I encountered this error:\\n\\n```sh\\nCannot connect to the Docker daemon at unix:///home/ray/.docker/desktop/docker.sock. Is the docker daemon running?\\n```\\n\\n![error](./img/docker-fetch-fail.png)\\n\\n## How do I tackle?\\n\\nRoot cause is:\\n\\nFirst, Docker CLI was configured to use **Docker Desktop**, even though I was running native Docker in linux.\\n\\nSecond, the configuration file at `~/.docker/config.json` contain:\\n\\n```json\\n{\\n  \\"auths\\": {},\\n  \\"credsStore\\": \\"desktop\\",\\n  \\"currentContext\\": \\"desktop-linux\\"\\n}\\n```\\n\\nThis caused Docker to:\\n\\n- Attempt to connect to a **nonexistent socket**: `/home/ray/.docker/desktop/docker.sock`\\n\\n- Call missing credentials helper: `docker-credential-desktop`\\n\\n## Solution\\n\\n### Ensure Docker Daemon is Running\\n\\n```sh\\nsudo systemctl start docker\\nsudo systemctl enable docker\\n```\\n\\n### Switch Context to the Default Linux One\\n\\n```sh\\ndocker context use default\\ndocker context ls               # to verify docker context set to default\\n```\\n\\n### Remove Faulty Docker Desktop Configuration\\n\\n```sh\\nrm -rf ~/.docker\\n```"},{"id":"docker-daemon-issue","metadata":{"permalink":"/docusaurus/blog/docker-daemon-issue","editUrl":"https://github.com/Izfaha/docusaurus/tree/main/blog/2025-juni/2025-7-27-docker-issue.md","source":"@site/blog/2025-juni/2025-7-27-docker-issue.md","title":"Cannot connect to the Docker daemon","description":"Issue","date":"2025-07-27T00:00:00.000Z","tags":[{"inline":false,"label":"linux","permalink":"/docusaurus/blog/tags/linux","description":"linux"},{"inline":false,"label":"Secure","permalink":"/docusaurus/blog/tags/secure","description":"Secure tag description"}],"readingTime":0.36,"hasTruncateMarker":true,"authors":[{"name":"Fa\'iz Maulana Habibi","title":"College Student of Dian Nuswantoro University","url":"https://github.com/Izfaha","page":{"permalink":"/docusaurus/blog/authors/all-faiz_maulana_habibi-articles"},"socials":{"x":"https://x.com/Xray","linkedin":"https://www.linkedin.com/in/Fa\'iz Maulana Habibi/","github":"https://github.com/Izfaha","newsletter":"https://www.greatfrontend.com"},"imageURL":"https://github.com/JoelMarcey.png","key":"faiz_maulana_habibi"}],"frontMatter":{"slug":"docker-daemon-issue","title":"Cannot connect to the Docker daemon","authors":"faiz_maulana_habibi","tags":["linux","secure"]},"unlisted":false,"prevItem":{"title":"Docker wrong credentials","permalink":"/docusaurus/blog/docker-wrong-credentials"},"nextItem":{"title":"Secure Copy in Linux","permalink":"/docusaurus/blog/scp"}},"content":"## Issue \\n\\nRecently, I was trying build docker image but it become an issue. Pop in my terminal up a messege. \\n\\n![issue](./img/docker-issue.jpeg)\\n\\n\x3c!-- truncate --\x3e\\n\\nThe main issue is I used wrong docker path in `docker context`. In my case, I remain using docker desktop path.\\n\\nAfter I change it using `docker context default`, suddenly it works.\\n\\n![solve](./img/docker.jpg)\\n\\nAnd I verify `docker context ls`\\n\\n![context_ls](./img/docker-context-ls.jpeg)"},{"id":"scp","metadata":{"permalink":"/docusaurus/blog/scp","editUrl":"https://github.com/Izfaha/docusaurus/tree/main/blog/2025-juni/2025-7-4-scp.md","source":"@site/blog/2025-juni/2025-7-4-scp.md","title":"Secure Copy in Linux","description":"Copy from Server to Local Computer","date":"2025-07-04T00:00:00.000Z","tags":[{"inline":false,"label":"linux","permalink":"/docusaurus/blog/tags/linux","description":"linux"},{"inline":false,"label":"Secure","permalink":"/docusaurus/blog/tags/secure","description":"Secure tag description"}],"readingTime":1.27,"hasTruncateMarker":true,"authors":[{"name":"Fa\'iz Maulana Habibi","title":"College Student of Dian Nuswantoro University","url":"https://github.com/Izfaha","page":{"permalink":"/docusaurus/blog/authors/all-faiz_maulana_habibi-articles"},"socials":{"x":"https://x.com/Xray","linkedin":"https://www.linkedin.com/in/Fa\'iz Maulana Habibi/","github":"https://github.com/Izfaha","newsletter":"https://www.greatfrontend.com"},"imageURL":"https://github.com/JoelMarcey.png","key":"faiz_maulana_habibi"}],"frontMatter":{"slug":"scp","title":"Secure Copy in Linux","authors":"faiz_maulana_habibi","tags":["linux","secure"]},"unlisted":false,"prevItem":{"title":"Cannot connect to the Docker daemon","permalink":"/docusaurus/blog/docker-daemon-issue"},"nextItem":{"title":"Setting Ip Static using NetworkManager","permalink":"/docusaurus/blog/ip-static-networkmanager"}},"content":"## Copy from Server to Local Computer\\n\\nUtilizing this command ```scp username@ip-server:/path/ke/file.txt /lokasi/di/local```.\\n\\n```sh\\nscp user@192.168.1.12:/home/user/file.txt ~/Download\\n```\\n\x3c!-- truncate --\x3e\\n## Upload from Local to Server\\n\\nIni untuk upload file dari local ke server. ```scp ~/lokasi/file/di/local user@ip-server:/path/ke/lokasi```.\\n\\n```sh\\nscp ~/Documents/file.txt user@192.168.1.12:/home/user/Downloads\\n```\\n\\n:::note[Optional]\\nThere are several option you are able to use, such as:\\\\\\n```-P``` using your desire port. like ```-P 22```.\\\\\\nexample:\\n\\n```sh\\nscp -P 2223 user@192.168.1.12:/home/user/Project/file.txt ~/Downloads\\n```\\n\\nCommand tersebut akan mengcopy file.txt ke dalam directory ```Downloads``` lewat port 2223.\\\\\\nexample:\\n\\n```-r``` recursive, if you need to copy all of file inside a directory.\\n\\n```sh\\nscp -r ~/Downloads/directory-main user@192.168.1.12:/home/user/Projects/\\n```\\n\\nPerintah tersebut, akan mengupload semua file yang ada di directory ```directory-main``` ke dalam directory server ```Projects```.\\n\\n```-i``` using private key.\\\\\\nexample:\\n\\n```sh\\nscp -i ~/.ssh/id_rsh/ssh-key.pem ~/Documents/file.txt user@192.168.1.12:/home/user/Projects\\n```\\n\\nIni dilakukan ketika si server tidak menerima login via password.\\n\\n```-C``` using compres data (it is faster if your files are too big).\\\\\\nexample:\\n\\n```sh\\nscp -C bigfile.zip user@192.168.1.20:/home/user/Documents\\n```\\n\\nGunakan ini untuk kompresi file yang berukuran besar agar mempercepat data transfering.\\n\\nAddition :\\nYou can combine all of command like\\n\\n```sh\\nscp -r -P 2345 -i ~/.ssh/id_rsa ~/Projects user@192.168.6.123:/home/user/Downloads\\n```\\n\\nCommand ini akan mengupload semua file di directory ```Projects``` ke directory server ```Downloads``` dengan private key dan melewati port 2345.\\n\\n:::"},{"id":"ip-static-networkmanager","metadata":{"permalink":"/docusaurus/blog/ip-static-networkmanager","editUrl":"https://github.com/Izfaha/docusaurus/tree/main/blog/2025-juni/2025-7-1-set-ipstatic-nm.md","source":"@site/blog/2025-juni/2025-7-1-set-ipstatic-nm.md","title":"Setting Ip Static using NetworkManager","description":"Set using NetworkManager","date":"2025-07-01T00:00:00.000Z","tags":[{"inline":false,"label":"arch","permalink":"/docusaurus/blog/tags/arch","description":"Arch Linux"},{"inline":false,"label":"linux","permalink":"/docusaurus/blog/tags/linux","description":"linux"}],"readingTime":1.21,"hasTruncateMarker":true,"authors":[{"name":"Fa\'iz Maulana Habibi","title":"College Student of Dian Nuswantoro University","url":"https://github.com/Izfaha","page":{"permalink":"/docusaurus/blog/authors/all-faiz_maulana_habibi-articles"},"socials":{"x":"https://x.com/Xray","linkedin":"https://www.linkedin.com/in/Fa\'iz Maulana Habibi/","github":"https://github.com/Izfaha","newsletter":"https://www.greatfrontend.com"},"imageURL":"https://github.com/JoelMarcey.png","key":"faiz_maulana_habibi"}],"frontMatter":{"slug":"ip-static-networkmanager","title":"Setting Ip Static using NetworkManager","authors":"faiz_maulana_habibi","tags":["arch","linux"]},"unlisted":false,"prevItem":{"title":"Secure Copy in Linux","permalink":"/docusaurus/blog/scp"},"nextItem":{"title":"File Error","permalink":"/docusaurus/blog/docusaurus"}},"content":"## Set using NetworkManager\\n\\nFirst up, we have to look up into our interface we are using.\\nTo verify write down this command.\\n\\n```sh\\nip link\\n```\\n\x3c!-- truncate --\x3e\\nit will be different in other distro. In my case, it shown up using wlp2s0.\\nSetting up the IP to static is piece of cake, Just bash it out.\\n\\n```sh\\nnmcli connection modify \\"COE-WIFI\\" ipv4.addresses 192.168.77.235/24\\nnmcli connection modify \\"COE-WIFI\\" ipv4.gateway 192.168.77.254\\nnmcli connection modify \\"COE-WIFI\\" ipv4.dns \\"1.1.1.1 8.8.8.8 8.8.4.4\\"\\nnmcli connection modify \\"COE-WIFI\\" ipv4.method manual\\n```\\n\\n:::caution[Important]\\nPlace ```COE_WIFI``` with your actual wifi name.\\\\\\n```ipv4.addresses your-ip/network-lenght```\\\\\\n```ipv4.gateway your-gateway```\\\\\\n```ipv4.dns \\"8.8.8.8 8.8.4.4\\"```\\\\\\n```ipv4.method manual```\\n:::\\n\\n:::note[Note]\\nIf you use LAN or Ethernet cable just change its name according to your LAN, like \'wired connection 1\'.\\n\\n```sh\\nnmcli connection up \\"Wired connection 1\\"\\n```\\n\\nJust it dude!\\n:::\\n\\nThen check your ip using ```ip a```.\\nAnd boom! you pull it off dawg!\\n\\n## Issues\\n\\n1. Can not connect internet when LAN is pluged in.\\n    - You need to remove your connection using this command.\\n\\n    ```sh\\n    nmcli connection delete \\"Wired connection 1\\"\\n    ```\\n\\n    Then verify, whether your connection to browse or google, and check your IP `ip a`.\\n    If you need to auto connect when pluging your LAN in, just use this command.\\n\\n    ```sh\\n    nmcli connection modify \\"Wired connection 1\\" connection.autoconnect yes\\n    ```\\n\\n    - Cara hapus IP dari eth0\\n\\n    ```sh\\n    sudo ip addr del 192.168.77.151/24 dev eth0\\n    ```"},{"id":"docusaurus","metadata":{"permalink":"/docusaurus/blog/docusaurus","editUrl":"https://github.com/Izfaha/docusaurus/tree/main/blog/2025-juni/2025-6-27-docusaurus-error.md","source":"@site/blog/2025-juni/2025-6-27-docusaurus-error.md","title":"File Error","description":"Docusaurus : get error after temoving file inside \'/blog\'","date":"2025-06-27T00:00:00.000Z","tags":[{"inline":false,"label":"linux","permalink":"/docusaurus/blog/tags/linux","description":"linux"},{"inline":false,"label":"Docusaurus","permalink":"/docusaurus/blog/tags/docusaurus","description":"Docusaurus tag description"}],"readingTime":0.83,"hasTruncateMarker":true,"authors":[{"name":"Fa\'iz Maulana Habibi","title":"College Student of Dian Nuswantoro University","url":"https://github.com/Izfaha","page":{"permalink":"/docusaurus/blog/authors/all-faiz_maulana_habibi-articles"},"socials":{"x":"https://x.com/Xray","linkedin":"https://www.linkedin.com/in/Fa\'iz Maulana Habibi/","github":"https://github.com/Izfaha","newsletter":"https://www.greatfrontend.com"},"imageURL":"https://github.com/JoelMarcey.png","key":"faiz_maulana_habibi"}],"frontMatter":{"slug":"docusaurus","title":"File Error","authors":"faiz_maulana_habibi","tags":["linux","docusaurus"]},"unlisted":false,"prevItem":{"title":"Setting Ip Static using NetworkManager","permalink":"/docusaurus/blog/ip-static-networkmanager"},"nextItem":{"title":"Linux","permalink":"/docusaurus/blog/linux"}},"content":"\x3c!-- truncate --\x3e\\n\\n## Docusaurus : get error after temoving file inside \'/blog\'\\n\\nWhen I remove a file inside \'/blog\', I get this error\\n\\n```text\\nERROR in ./.docusaurus/registry.js 1:11337-11448\\n\\nModule not found: Error: Can\'t resolve \'@site/blog/2021-08-26-welcome/index.md?truncated=true\' in \'/home/ray/Documents/documentation/.docusaurus\'\\n\\nERROR in ./.docusaurus/registry.js 1:11505-11581\\n\\nModule not found: Error: Can\'t resolve \'@site/blog/2021-08-26-welcome/index.md?truncated=true\' in \'/home/ray/Documents/documentation/.docusaurus\'\\n\\nERROR in ./.docusaurus/registry.js 1:12427-12532\\n\\nModule not found: Error: Can\'t resolve \'@site/blog/2021-08-26-welcome/index.md\' in \'/home/ray/Documents/documentation/.docusaurus\'\\n\\nERROR in ./.docusaurus/registry.js 1:12574-12635\\n\\nModule not found: Error: Can\'t resolve \'@site/blog/2021-08-26-welcome/index.md\' in \'/home/ray/Documents/documentation/.docusaurus\'\\n```\\n\\nand it is caused by \'.docusaurus\' file cache.\\n\\n:::tip[My tips]\\n\\n## How to tackle this?\\n\\nYou just need to remove \'.docusaurus\' cache using\\n\\n```sh\\nrm -rf .docusaurus build\\n```\\n\\nAfterwards re-run command\\n\\n```sh\\nnpm run start\\n```\\n\\n:::"},{"id":"linux","metadata":{"permalink":"/docusaurus/blog/linux","editUrl":"https://github.com/Izfaha/docusaurus/tree/main/blog/2025-juni/2025-6-26-linux-installation.md","source":"@site/blog/2025-juni/2025-6-26-linux-installation.md","title":"Linux","description":"","date":"2025-06-26T00:00:00.000Z","tags":[{"inline":false,"label":"Docusaurus","permalink":"/docusaurus/blog/tags/docusaurus","description":"Docusaurus tag description"},{"inline":false,"label":"linux","permalink":"/docusaurus/blog/tags/linux","description":"linux"}],"readingTime":0.01,"hasTruncateMarker":true,"authors":[{"name":"Fa\'iz Maulana Habibi","title":"College Student of Dian Nuswantoro University","url":"https://github.com/Izfaha","page":{"permalink":"/docusaurus/blog/authors/all-faiz_maulana_habibi-articles"},"socials":{"x":"https://x.com/Xray","linkedin":"https://www.linkedin.com/in/Fa\'iz Maulana Habibi/","github":"https://github.com/Izfaha","newsletter":"https://www.greatfrontend.com"},"imageURL":"https://github.com/JoelMarcey.png","key":"faiz_maulana_habibi"}],"frontMatter":{"slug":"linux","title":"Linux","authors":["faiz_maulana_habibi"],"tags":["docusaurus","linux"]},"unlisted":false,"prevItem":{"title":"File Error","permalink":"/docusaurus/blog/docusaurus"}},"content":"\x3c!-- truncate --\x3e"}]}}')}}]);